import React from 'react';
import HeaderSection from '../Header.js/header';
import CarsList from '../../../carsList/carsList'
import './Catalog.css'


const Catalog = () => {
    return (
        <div style={{ padding: '20px', maxWidth: '1000px', margin: '0 auto' }}>
            <HeaderSection />
            <CarsList />
        </div>
    );
};

export default Catalog;
